import React, { Component } from 'react';
import { connect } from 'react-redux';
import $ from 'jquery';
import NotFound from './images/imagenotfound.jpg';

class Lists extends Component {
    constructor(props) {
        super(props)
        this.handleClick = this.handleClick.bind(this);

        this.state = {
                url: 'https://cs371-backend.herokuapp.com/list/',
                movies: [],
                lists: []
        }
    }

    componentDidMount() {
  /*      GET /list/ HTTP/1.1
Host: cs371-backend.herokuapp.com
Connection: keep-alive
Cache-Control: max-age=0
Upgrade-Insecure-Requests: 1
User-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/81.0.4044.129 Safari/537.36
Accept: text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng;q=0.8,application/signed-exchange;v=b3;q=0.9
Sec-Fetch-Site: none
Sec-Fetch-Mode: navigate
Sec-Fetch-User: ?1
Sec-Fetch-Dest: document
Accept-Encoding: gzip, deflate, br
Accept-Language: en-US,en;q=0.9
*/
        $.ajax({
            method: "GET",
            url: this.state.url,
            accepts: 'text/html, application/xhtml+xml, application/xml; q=0.9, image/webp, image/apng, */*',
            context: document,
            success: (data) => {
                this.setState({
                    lists: data.results
                })
            },
            error: (data) => {
                alert("Error");
            }
        })
    }

    handleClick(event) {

    }

    render() {
        let link;
        return (
            <div>
                {this.state.movies.map((data)=>{
                    return(
                        <div>
                            <h1>{data.title}</h1>
                        </div>
                    )
                })}
            </div>
        );
    }
}
export default Lists;
